CREATE DATABASE SkyRoutesAnalysis;
USE SkyRoutesAnalysis;

CREATE TABLE AirlineRoutes (
    FlightID VARCHAR(10) PRIMARY KEY,
    RouteCode VARCHAR(20),
    Airline VARCHAR(50),
    DepartureAirport VARCHAR(50),
    ArrivalAirport VARCHAR(50),
    DepartureCity VARCHAR(50),
    ArrivalCity VARCHAR(50),
    DepartureCountry VARCHAR(50),
    ArrivalCountry VARCHAR(50),
    DistanceKM INT,
    FlightDurationMin INT,
    AircraftType VARCHAR(20),
    WeeklyFrequency INT,
    Stops INT DEFAULT 0,
    Alliance VARCHAR(30),
    BaseFareUSD DECIMAL(10,2)
);


